import React from 'react';
import './App.css';
import Header from "./components/header_top/header.jsx";
import Create_box from "./components/gallery_boxs/create_box.jsx";
import {apartments} from "./components/app_data/apartments_array";
import {cities} from "./components/app_data/cities_array";
import './components/gallery_boxs/create_box.css';



class App extends React.Component{
    render() {
        return(
            <div>
                <Header/>
                <div className={"container-grid"} id={"fourth_row"}>
                    <h1 className={"titel_of_boxs"}>My Apartments</h1>
                    <Create_box items = {apartments}/>
                    <h1>My Cities</h1>
                    <Create_box items = {cities}/>
                </div>
            </div>
        )
    }
}

export default App;
